import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Open a product modal to ensure modal is present
    // Use the first visible product card and click it
    await page.waitForSelector('.product-card', { timeout: 5000 });
    const productCards = await page.$$('.product-card');
    if (productCards.length === 0) {
      throw new Error('No product cards found to open modal');
    }
    await productCards[0].click();

    // Wait for modal to appear using a unique modal selector
    await page.waitForSelector('#productModal', { timeout: 5000 });
    // Wait for modal to be visible (display: block)
    await page.waitForSelector('#productModal[style*="display: block"]', { timeout: 5000 });

    // Take screenshot with modal open
    const step2 = path.join(screenshotsDir, 'step_2_modal_open.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Press Escape key to close the modal
    await page.keyboard.press('Escape');

    // Wait for modal to be hidden (display: none)
    await page.waitForSelector('#productModal[style*="display: none"]', { timeout: 5000 });

    // Take screenshot after closing modal
    const step3 = path.join(screenshotsDir, 'step_3_modal_closed.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract modal visibility state for verification
    const modalDisplay = await page.$eval('#productModal', el => getComputedStyle(el).display);

    return {
      success: true,
      action: "Opened a product modal and closed it using the Escape key",
      extractedData: {
        modalDisplayAfterEscape: modalDisplay
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
